import React from 'react';
import style from 'styled-components';

const StyledIndexPage = style.div`
	display: flex;
	height: 100%;
`

const StyledBlockRole = style.div`
	display: flex;
	background: #E5E5E5;
	background: linear-gradient(180deg, #924FD1 35%, #5454E2 100%);
	align-items: center;
	justify-content: center;
	height: 100%;
	width: 50%;

	font-family: Roboto;
	font-style: normal;
	font-weight: 500;
	font-size: 48px;
	line-height: 54px;
	color: #FFFFFF;

`

const BlockRole = ( { role } ) => {
	return(
		<StyledBlockRole>
			<h1>
				{role}
			</h1>
		</StyledBlockRole>
	)
}

const IndexPage = () => {
	return(
		<StyledIndexPage>
			<BlockRole role="Я автор" />
			<BlockRole role="Я редактор" />
		</StyledIndexPage>
	)
}

export default IndexPage
